INSERT INTO `informaciones` VALUES (2,'#horas_por_convenio','Se refiere a la cantidad de horas maximas mensuales por convenio que debe trabajar un empleado, para los mensuales o los jornalizados.','2008-10-20 12:03:05','2008-11-03 14:13:38',1,1,0,508),(3,'#presentismo_dias_tolerancia','Se refiere a los días de tolerancia que tiene el cnovenio para abonar el presentismo. Ej: si falta menos de 2 dos igual se abona el presentismo','2008-10-31 11:33:10','2009-02-20 12:18:23',1,1,0,508),(4,'#presentismo_porcentaje','Se refiere al porcentaje sobre el @sueldo_bruto o sobre el @sueldo_basico (depende del Empleador) que se abona en concepto de presentismo','2008-10-31 11:37:18','2008-10-31 11:37:18',1,1,0,508),(5,'#presentismo_importe','Se refiere al importe fijo que se abona en concepto de presentismo','2008-10-31 11:39:10','2008-10-31 11:39:10',1,1,0,508),(6,'#impresion_del_aporte_solidario','es el campo que se utiliza para colocar como sale impreso el concepto del aporte solidario para cada convenio','2008-11-03 14:49:30','2008-11-05 10:16:35',1,1,0,508),(7,'#impresion_de_seguros_de_vida','es el campo que se utiliza para colocar como sale impreso el concepto del seguro de vida para cada convenio','2008-11-05 10:17:45','2008-11-05 10:17:45',1,1,0,508),(8,'#impresion_de_afiliacion','es el campo que se utiliza para colocar como sale impreso el concepto de la afiliacion al sindicato  para cada convenio','2008-11-05 10:24:23','2008-11-05 10:24:23',1,1,0,508),(9,'#antiguedad_porcentaje','Es el porcentaje de antiguedad definido por cada convenio colectivo.','2009-01-21 18:20:37','2009-02-20 13:50:48',1,1,0,508),(11,'#cuota_sindical_afiliado','Es el porcentaje para el calculo de la contribucion de cuota sindical para los trabajadores afiliados al sindicato. ','2009-02-21 21:52:36','2009-02-26 13:13:16',1,1,0,508),(12,'#seguro_de_vida_importe','Es un importe fijo para el aporte del Seguro de Vida que determina cada Convenio Colectivo.','2009-02-21 22:02:02','2009-02-21 22:03:39',1,1,0,508),(13,'#seguro_de_vida_porcentaje','Es el porcenaje para el aporte del Seguro de Vida que determina cada Convenio Colectivo.','2009-02-21 22:04:49','2009-02-21 22:04:49',1,1,0,508),(14,'#cuota_sindical_no_afiliado','Es el porcentaje para el calculo de la contribucion de cuota sindical para los trabajadores no afiliados al sindicato.','2009-02-26 13:10:55','2009-02-26 13:13:29',1,1,0,508),(15,'#valor_km_recorridos','Es el valor de la hora extraordinaria por kilómetro recorrido','2010-06-24 19:18:50','2010-06-24 20:16:53',1,1,0,508),(16,'#garantia_minima','','2010-06-25 12:20:01','2010-06-25 12:20:01',1,1,0,508);
