  `liquidacion_id` int(11) unsigned DEFAULT NULL,
  `liquidacion_tipo` enum('Normal','Sac','Vacaciones','Final','Especial') NOT NULL DEFAULT 'Normal',
  `concepto_id` int(11) unsigned DEFAULT NULL,
