  `subtipo` varchar(100) NOT NULL,
  `data` text NOT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `user_id` int(11) unsigned NOT NULL,
  `role_id` int(11) unsigned NOT NULL,
  `group_id` int(11) unsigned NOT NULL,
  `permissions` int(11) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `user_idx` (`user_id`),
  KEY `role_idx` (`role_id`),
  KEY `group_idx` (`group_id`),
  KEY `permissions_idx` (`permissions`),
  KEY `relacion_idx` (`relacion_id`),
  KEY `liquidacion_idx` (`liquidacion_id`),
  KEY `concepto_idx` (`concepto_id`),
  CONSTRAINT `novedades_ibfk_1` FOREIGN KEY (`relacion_id`) REFERENCES `relaciones` (`id`),
  CONSTRAINT `novedades_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `usuarios` (`id`),
  CONSTRAINT `novedades_ibfk_3` FOREIGN KEY (`liquidacion_id`) REFERENCES `liquidaciones` (`id`),
  CONSTRAINT `novedades_ibfk_4` FOREIGN KEY (`concepto_id`) REFERENCES `conceptos` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
